class Datos {
  constructor() {
    this.tipo = 'DATOS';
    this.id = '';
    this.foto1 = '';
    this.local = [];
    this.titulo = [];
    this.colores = [];
    this.tituloGeneral = '';
  }
}

export default Datos;
